import React, { useState } from 'react';
import Cell from './Cell'
import './Table.css';

const Table = () => {
    const [turn, setTurn] = useState();
    const [cells, setCells] = useState(Array(9).fill(''));

    const cellFormat = () => {
        return <Cell cells={cells} setCells={setCells} turn={turn} setTurn={setTurn} />
    }

    return (
        <div className="container">
            <table className="table">
                <tbody>
                    <tr>
                        <cellFormat id={0} />
                        <cellFormat id={1} />
                        <cellFormat id={2} />
                    </tr>
                    <tr>
                        <cellFormat id={3} />
                        <cellFormat id={4} />
                        <cellFormat id={5} />
                    </tr>
                    <tr>
                        <cellFormat id={6} />
                        <cellFormat id={7} />
                        <cellFormat id={8} />
                    </tr>
                </tbody>
            </table>
        </div>
    );
}

export default Table;
